description:
This offbeat John Wayne vehicle casts the Duke as Detective Jim Brannigan, an Irish-American detective at large in London. After the requisite culture-clash routines, it's down to business as Brannigan teams with Scotland Yard official Commander Swann (Richard Attenborough) to corral a crook who has absconded to England to avoid extradition. Judy Geeson co-stars as Jennifer Thatcher, a cute lady constable who spends most over her time fending off Brannigan's inbred chauvinism. Brannigan was co-written by Christopher Trumbo, the son of former blacklistee Dalton Trumbo. 
